# \* рЃЮрЃЌрЃ«рЃў рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮ рЃЏрЃљрЃарЃЌрЃЎрЃБрЃЌрЃ«рЃћрЃЊрЃў (рЃАрЃћрЃюрЃЊрЃЋрЃўрЃЕрЃўрЃА рЃЏрЃАрЃњрЃљрЃЋрЃАрЃў рЃњрЃљрЃюрЃџрЃљрЃњрЃћрЃЉрЃўрЃЌ) рЃљрЃарЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЊрЃњрЃћрЃюрЃўрЃџрЃў рЃерЃљрЃЋ рЃќрЃдрЃЋрЃљрЃерЃў рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџ рЃарЃБрЃЎрЃљрЃќрЃћ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃњрЃЋрЃћрЃарЃЊрЃўрЃЌ, рЃўрЃЏрЃўрЃАрЃљрЃЌрЃЋрЃўрЃА, рЃарЃЮрЃЏ рЃЏрЃљрЃЌ рЃљрЃАрЃљрЃ«рЃЮрЃю рЃўрЃАрЃћрЃЌрЃў рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃў рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃА рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃљ рЃарЃЮрЃЏрЃћрЃџрЃўрЃЏрЃћ рЃЎрЃЮрЃюрЃЎрЃарЃћрЃбрЃБрЃџ рЃЦрЃЋрЃћрЃДрЃљрЃюрЃљрЃАрЃЌрЃљрЃю рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџрЃў рЃарЃБрЃЎрЃўрЃА рЃЎрЃЮрЃюрЃбрЃћрЃЦрЃАрЃбрЃерЃў рЃљрЃа рЃљрЃарЃўрЃА рЃерЃћрЃАрЃљрЃФрЃџрЃћрЃЉрЃћрЃџрЃў, рЃарЃЮрЃњрЃЮрЃарЃўрЃфрЃљрЃљ:
# - **Stateless** (рЃЏрЃЮрЃљрЃЦрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃљрЃарЃЏрЃЦрЃЮрЃюрЃћ рЃърЃўрЃарЃћрЃЉрЃў) рЃЏрЃљрЃарЃЌрЃЎрЃБрЃЌрЃ«рЃћрЃЊрЃў: рЃњрЃЋрЃўрЃЕрЃЋрЃћрЃюрЃћрЃЉрЃА рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџ рЃАрЃљрЃџрЃЊрЃЮрЃА рЃўрЃАрЃћрЃЌрЃў рЃърЃўрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЋрЃўрЃАрЃљрЃф рЃљрЃа рЃњрЃљрЃљрЃЕрЃюрЃўрЃљрЃЌ рЃљрЃарЃфрЃћрЃарЃЌрЃў рЃЦрЃЋрЃћрЃДрЃюрЃўрЃА рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃљ.
# - **Not stated** (рЃљрЃБрЃдрЃюрЃўрЃерЃюрЃљрЃЋрЃў) рЃЏрЃљрЃарЃЌрЃЎрЃБрЃЌрЃ«рЃћрЃЊрЃў: рЃњрЃЋрЃўрЃЕрЃЋрЃћрЃюрЃћрЃЉрЃА рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџ рЃАрЃљрЃџрЃЊрЃЮрЃА рЃўрЃАрЃћрЃЌрЃў рЃърЃўрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃарЃЮрЃЏрЃћрЃџрЃЌрЃљ рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљрЃф рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃерЃў рЃљрЃа рЃљрЃарЃўрЃА рЃљрЃдрЃюрЃўрЃерЃюрЃБрЃџрЃў.
# - **Other** (рЃАрЃ«рЃЋрЃљ) рЃЏрЃљрЃарЃЌрЃЎрЃБрЃЌрЃ«рЃћрЃЊрЃў: рЃњрЃЋрЃўрЃЕрЃЋрЃћрЃюрЃћрЃЉрЃА рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџ рЃАрЃљрЃџрЃЊрЃЮрЃА рЃўрЃАрЃћрЃЌрЃў рЃърЃўрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф рЃљрЃарЃўрЃљрЃю рЃарЃЮрЃЏрЃћрЃџрЃўрЃЏрЃћ рЃЎрЃЮрЃюрЃЎрЃарЃћрЃбрЃБрЃџрЃў рЃЦрЃЋрЃћрЃДрЃюрЃўрЃА рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃћрЃЉрЃў, рЃЌрЃБрЃЏрЃфрЃљ рЃЏрЃљрЃЌрЃў рЃЦрЃЋрЃћрЃДрЃљрЃюрЃљ рЃљрЃа рЃљрЃарЃўрЃА рЃАрЃљрЃЦрЃАрЃбрЃљрЃбрЃўрЃА рЃЏрЃўрЃћрЃа рЃњрЃљрЃАрЃљрЃ»рЃљрЃарЃЮрЃЋрЃћрЃЉрЃБрЃџрЃў рЃЦрЃЋрЃћрЃДрЃюрЃћрЃЉрЃўрЃА рЃАрЃўрЃљрЃерЃў рЃЊрЃљ рЃљрЃЏрЃўрЃбрЃЮрЃЏ рЃљрЃарЃўрЃљрЃю рЃљрЃЏ "рЃАрЃ«рЃЋрЃљ" рЃЎрЃљрЃбрЃћрЃњрЃЮрЃарЃўрЃљрЃерЃў рЃЌрЃљрЃЋрЃЏрЃЮрЃДрЃарЃўрЃџрЃў.
# - **Total** (рЃ»рЃљрЃЏрЃў) рЃЏрЃљрЃарЃЌрЃЎрЃБрЃЌрЃ«рЃћрЃЊрЃў: рЃњрЃЋрЃўрЃЕрЃЋрЃћрЃюрЃћрЃЉрЃА рЃ»рЃљрЃЏрЃБрЃа рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџ рЃАрЃљрЃџрЃЊрЃЮрЃА рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџрЃў рЃърЃћрЃарЃўрЃЮрЃЊрЃўрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў рЃЊрЃљ рЃљрЃЦ рЃерЃћрЃАрЃБрЃџрЃўрЃљ рЃДрЃЋрЃћрЃџрЃљ рЃЏрЃўрЃњрЃарЃљрЃюрЃбрЃўрЃА рЃ»рЃљрЃЏрЃБрЃарЃў рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃљ рЃЏрЃљрЃЌрЃў рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃЏрЃўрЃБрЃ«рЃћрЃЊрЃљрЃЋрЃљрЃЊ.

# # рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџрЃў рЃАрЃљрЃџрЃЊрЃЮ
# 
# рЃќрЃћрЃЏрЃЮрЃЌ рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџрЃў рЃарЃБрЃЎрЃљ рЃерЃћрЃЦрЃЏрЃюрЃўрЃџрЃўрЃљ рЃўрЃЏрЃўрЃАрЃљрЃЌрЃЋрЃўрЃА, рЃарЃЮрЃЏ рЃњрЃЋрЃўрЃЕрЃЋрЃћрЃюрЃЮрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџрЃў рЃАрЃљрЃџрЃЊрЃЮ рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ, рЃерЃћрЃ»рЃљрЃЏрЃћрЃЉрЃБрЃџрЃў рЃЊрЃарЃЮрЃўрЃА рЃ«рЃљрЃюрЃњрЃарЃФрЃџрЃўрЃЋ рЃърЃћрЃарЃўрЃЮрЃЊрЃќрЃћ (рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџрЃў рЃЊрЃарЃЮрЃўрЃА рЃърЃћрЃарЃўрЃЮрЃЊрЃў рЃЊрЃљрЃЏрЃЮрЃЎрЃўрЃЊрЃћрЃЉрЃБрЃџрЃўрЃљ рЃЌрЃљрЃЋрЃљрЃЊ рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃБрЃарЃў рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃўрЃА рЃ«рЃћрЃџрЃЏрЃўрЃАрЃљрЃгрЃЋрЃЊрЃЮрЃЏрЃЮрЃЉрЃљрЃќрЃћ). рЃарЃБрЃЎрЃљрЃќрЃћ рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃБрЃџрЃўрЃљ рЃЮрЃарЃў рЃцрЃћрЃарЃўрЃА рЃерЃЎрЃљрЃџрЃљ, рЃгрЃўрЃЌрЃћрЃџрЃў рЃЊрЃљ рЃЏрЃгрЃЋрЃљрЃюрЃћ, рЃгрЃўрЃЌрЃћрЃџрЃў рЃерЃЎрЃљрЃџрЃљ рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃБрЃџрЃўрЃљ рЃўрЃАрЃћрЃЌрЃў рЃЦрЃЋрЃћрЃДрЃюрЃћрЃЉрЃўрЃА рЃљрЃдрЃАрЃљрЃюрЃљрЃўрЃерЃюрЃљрЃЋрЃљрЃЊ, рЃарЃЮрЃЏрЃџрЃўрЃА рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃАрЃљрЃф рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџрЃў рЃАрЃљрЃџрЃЊрЃЮ рЃљрЃарЃўрЃА рЃюрЃћрЃњрЃљрЃбрЃўрЃБрЃарЃў рЃарЃўрЃфрЃ«рЃЋрЃў. рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃљрЃЊ, рЃЏрЃгрЃЋрЃљрЃюрЃћ рЃерЃЎрЃљрЃџрЃљ рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃБрЃџрЃўрЃљ рЃўрЃАрЃћрЃЌрЃў рЃЦрЃЋрЃћрЃДрЃюрЃћрЃЉрЃўрЃА рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃљрЃЊ, рЃарЃЮрЃЏрЃџрЃўрЃА рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃАрЃљрЃф рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃњрЃљрЃарЃћ рЃЏрЃўрЃњрЃарЃљрЃфрЃўрЃБрЃџрЃў рЃАрЃљрЃџрЃЊрЃЮ рЃЊрЃљрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃарЃўрЃфрЃ«рЃЋрЃўрЃљ. рЃЌрЃљрЃЋрЃљрЃЊ рЃцрЃћрЃарЃўрЃА рЃўрЃюрЃбрЃћрЃюрЃАрЃўрЃЋрЃЮрЃЉрЃљ рЃЎрЃў рЃЮрЃарЃўрЃЋрЃћ рЃцрЃћрЃарЃўрЃА рЃерЃћрЃЏрЃЌрЃ«рЃЋрЃћрЃЋрЃљрЃерЃў рЃЏрЃўрЃњрЃЋрЃљрЃюрЃўрЃерЃюрЃћрЃЉрЃА рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃў рЃарЃўрЃфрЃ«рЃЋрЃўрЃА рЃАрЃўрЃЊрЃўрЃЊрЃћрЃА (рЃћ.рЃў. рЃарЃљрЃф рЃБрЃцрЃарЃЮ рЃўрЃюрЃбрЃћрЃюрЃАрЃўрЃБрЃарЃўрЃљ рЃцрЃћрЃарЃў, рЃЏрЃўрЃЌ рЃБрЃцрЃарЃЮ рЃЊрЃўрЃЊрЃўрЃљ рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃў рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃБрЃарЃў рЃЏрЃљрЃЕрЃЋрЃћрЃюрЃћрЃЉрЃћрЃџрЃў). рЃЦрЃЋрЃћрЃДрЃюрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃцрЃћрЃарЃћрЃЉрЃўрЃА рЃЏрЃўрЃюрЃўрЃГрЃћрЃЉрЃљ (рЃгрЃўрЃЌрЃџрЃљрЃЊ рЃўрЃЦрЃюрЃћрЃЉрЃљ рЃЏрЃЮрЃюрЃўрЃерЃюрЃБрЃџрЃў рЃЌрЃБ рЃЏрЃгрЃЋрЃљрЃюрЃћрЃЊ) рЃЊрЃљ рЃљрЃАрЃћрЃЋрЃћ рЃЏрЃљрЃЌрЃў рЃцрЃћрЃарЃћрЃЉрЃўрЃА рЃўрЃюрЃбрЃћрЃюрЃАрЃўрЃБрЃарЃЮрЃЉрЃўрЃА рЃерЃћрЃарЃЕрЃћрЃЋрЃљрЃф рЃљрЃарЃўрЃА рЃљрЃЋрЃбрЃЮрЃЏрЃљрЃбрЃБрЃарЃў рЃърЃарЃЮрЃфрЃћрЃАрЃў рЃЊрЃљ рЃЊрЃљрЃЏрЃЮрЃЎрЃўрЃЊрЃћрЃЉрЃБрЃџрЃўрЃљ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃЊрЃљ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃА рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃБрЃа рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃќрЃћ. рЃљрЃдрЃюрЃўрЃерЃюрЃБрЃџрЃў рЃљрЃЋрЃбрЃЮрЃЏрЃљрЃбрЃБрЃарЃў рЃърЃарЃЮрЃфрЃћрЃАрЃўрЃА рЃбрЃћрЃЦрЃюрЃўрЃЎрЃБрЃарЃў рЃљрЃдрЃгрЃћрЃарЃљ рЃЊрЃљ рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃў Python-рЃЎрЃЮрЃЊрЃў рЃАрЃарЃБрЃџрЃўрЃљрЃЊ рЃдрЃўрЃљ рЃАрЃљрЃ«рЃўрЃЌ рЃерЃћрЃњрЃўрЃФрЃџрЃўрЃљрЃЌ рЃўрЃ«рЃўрЃџрЃЮрЃЌ рЃљрЃЏрЃљрЃЋрЃћ рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃўрЃА [рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃћрЃюрЃЮрЃЋрЃљрЃю рЃЋрЃћрЃарЃАрЃўрЃљрЃерЃў](../).
