# рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃБрЃџрЃў рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃў:
# - рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃБрЃарЃў рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃў "рЃўрЃЏрЃўрЃњрЃарЃљрЃюрЃбрЃћрЃЉрЃўрЃА рЃЊрЃљ рЃћрЃЏрЃўрЃњрЃарЃљрЃюрЃбрЃћрЃЉрЃўрЃА рЃарЃўрЃфрЃ«рЃЮрЃЋрЃюрЃЮрЃЉрЃљ рЃАрЃЦрЃћрЃАрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ" (Excel рЃцрЃЮрЃарЃЏрЃљрЃбрЃерЃў) рЃЏрЃЮрЃърЃЮрЃЋрЃћрЃЉрЃБрЃџрЃўрЃљ 2022 рЃгрЃџрЃўрЃА 9 рЃўрЃЋрЃюрЃўрЃАрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃўрЃА (рЃАрЃљрЃЦрЃАрЃбрЃљрЃбрЃўрЃА) рЃЋрЃћрЃЉрЃАрЃљрЃўрЃбрЃўрЃЊрЃљрЃю: [geostat.ge](https://www.geostat.ge/ka/)
# 
# - рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃБрЃарЃў рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃў "рЃўрЃЏрЃўрЃњрЃарЃљрЃюрЃбрЃћрЃЉрЃўрЃА рЃЊрЃљ рЃћрЃЏрЃўрЃњрЃарЃљрЃюрЃбрЃћрЃЉрЃўрЃА рЃарЃўрЃфрЃ«рЃЮрЃЋрЃюрЃЮрЃЉрЃљ рЃАрЃЦрЃћрЃАрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ" (CSV рЃцрЃЮрЃарЃЏрЃљрЃбрЃерЃў) рЃЏрЃЮрЃърЃЮрЃЋрЃћрЃЉрЃБрЃџрЃўрЃљ 2022 рЃгрЃџрЃўрЃА 11 рЃўрЃЋрЃюрЃўрЃАрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃўрЃА (рЃАрЃљрЃЦрЃАрЃбрЃљрЃбрЃўрЃА) рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃБрЃарЃў рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃЌрЃљ рЃЉрЃљрЃќрЃћрЃЉрЃўрЃА рЃЋрЃћрЃЉрЃАрЃљрЃўрЃбрЃўрЃЊрЃљрЃю: [pc-axis.geostat.ge](http://pc-axis.geostat.ge/PXWeb/pxweb/ka/Database/)
# - рЃЏрЃћрЃбрЃљрЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃў (PDF рЃцрЃЮрЃарЃЏрЃљрЃбрЃерЃў) рЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџрЃў рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃБрЃарЃў рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃўрЃАрЃљрЃЌрЃЋрЃўрЃА рЃЏрЃЮрЃърЃЮрЃЋрЃћрЃЉрЃБрЃџрЃўрЃљ 2022 рЃгрЃџрЃўрЃА 14 рЃўрЃЋрЃюрЃўрЃАрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃАрЃбрЃљрЃбрЃўрЃАрЃбрЃўрЃЎрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃўрЃА (рЃАрЃљрЃЦрЃАрЃбрЃљрЃбрЃўрЃА) рЃЋрЃћрЃЉрЃАрЃљрЃўрЃбрЃўрЃЊрЃљрЃю: [geostat.ge](https://www.geostat.ge/ka/)
# - рЃарЃБрЃЎрЃўрЃА рЃЏрЃЮрЃюрЃљрЃфрЃћрЃЏрЃћрЃЉрЃў рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃАрЃљрЃќрЃдрЃЋрЃарЃћрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ *(1:10m Cultural Vectors - Admin 0 РђЊ Countries - (latest) version 5.1.1)* рЃЏрЃЮрЃърЃЮрЃЋрЃћрЃЉрЃБрЃџрЃўрЃљ 2022 рЃгрЃџрЃўрЃА 11 рЃўрЃЋрЃюрЃўрЃАрЃА "Natural Earth-рЃўрЃА" рЃЋрЃћрЃЉрЃАрЃљрЃўрЃбрЃўрЃЊрЃљрЃю: [naturalearthdata.com](https://www.naturalearthdata.com/)
